                <li style="box-sizing: border-box; border: 0px; font-size: 15px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;"><sup style="box-sizing: border-box; font-size: 11.25px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;">4</sup>Cần c&oacute; g&oacute;i cước dữ liệu. Mạng 5G chỉ khả dụng ở một số thị trường v&agrave; được cung cấp qua một số nh&agrave; mạng. Tốc độ c&oacute; thể thay đổi t&ugrave;y địa điểm v&agrave; nh&agrave; mạng.&nbsp;<a href="http://apple.com/iphone/cellular" rel="noopener" style="box-sizing: border-box; background-color: transparent; text-decoration: none; color: rgb(51, 51, 51); transition: all 0.2s linear 0s; box-shadow: none;">Để biết th&ocirc;ng tin về hỗ trợ mạng 5G, vui l&ograve;ng li&ecirc;n hệ nh&agrave; mạng v&agrave; truy cập apple.com/iphone/cellular</a>.</li>
                <li style="box-sizing: border-box; border: 0px; font-size: 15px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;"><sup style="box-sizing: border-box; font-size: 11.25px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;">5</sup>iPhone 14 Pro Max c&oacute; khả năng chống tia nước, chống nước v&agrave; chống bụi. Sản phẩm đ&atilde; qua kiểm nghiệm trong điều kiện ph&ograve;ng th&iacute; nghiệm c&oacute; kiểm so&aacute;t đạt mức IP68 theo ti&ecirc;u chuẩn IEC 60529 (chống nước ở độ s&acirc;u tối đa 6 m&eacute;t trong v&ograve;ng tối đa 30 ph&uacute;t). Khả năng chống tia nước, chống nước v&agrave; chống bụi kh&ocirc;ng phải l&agrave; c&aacute;c điều kiện vĩnh viễn. Khả năng n&agrave;y c&oacute; thể giảm do hao m&ograve;n th&ocirc;ng thường. Kh&ocirc;ng sạc pin khi iPhone đang bị ướt.</li>
                <li style="box-sizing: border-box; border: 0px; font-size: 15px; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;">Vui l&ograve;ng tham khảo hướng dẫn sử dụng để biết c&aacute;ch lau sạch v&agrave; l&agrave;m kh&ocirc; m&aacute;y. Kh&ocirc;ng bảo h&agrave;nh sản phẩm bị hỏng do thấm chất lỏng.</li>
